description:
Ian Stone mordas varje dag av paranormala existenser, for
att foljande dag vakna upp till ett nytt liv och aterigen bli
mordad. Den enda verkliga ar Jenny, men Jenny ar den som 
mordarna verkligen ar ute efter...hennes dod skulle tvinga Ian
att ta plats i en av deras kroppar...
Med bl.a. Mike Vogel och Jaime Murray.
